export default function CreateStudent(){
    return(
       
        <div className="container">
            <h2>Add new Student</h2>
            <form>
                <label htmlfor="id">ID:</label>
                <input type="text" id="id" name="id" />"

                <label htmlfor="name">ID:</label>
                <input type="text" id="name" name="name" />"            
             </form>
        </div>
    )
}
